import React, { useState } from "react";
import api from "./services/api";

import "./App.css";

function App() {
  const [email, setEmail] = useState("");
  const [feedback, setFeedback] = useState("");
  const [msgObg, setMsgObg] = useState();

  async function handleSubmit(event) {
    event.preventDefault();
    console.log(feedback);

    await api
      .post("/feedback", { email, feedback })
      .then(response => {
        console.log(response.data);

        if (response.status === 200) {
          setMsgObg(true);
        }
      })
      .catch(error => {
        alert("Serviço indisponível");
      });
  }

  return (
    <div className="container">
      <div className="content">
        <>
          <img
            alt="eu"
            href="data:image/png;base64,"
          />

          <p>
            Criei essa page para receber alguns feedbacks sendo
            positivo/negativo tanto para os meus projetos/minha pessoa. É isso
            vlw!
          </p>

          <form onSubmit={handleSubmit}>
            <label htmlFor="email">E-MAIL </label>
            <input
              id="email"
              type="email"
              value={email}
              onChange={event => setEmail(event.target.value)}
            />

            <label htmlFor="feedback">FeedBack</label>

            <input
              id="feedback"
              type="feedback"
              placeholder=""
              value={feedback}
              onChange={event => setFeedback(event.target.value)}
            />

            <button className="btn" type="submit">
              feedback me
            </button>
          </form>
          {msgObg ? (
            <>
              <br />
              <br />
              <p>
                Muito Obrigado pelo feedback. <strong>@alexsouzasilvax</strong>
              </p>
            </>
          ) : (
            <> </>
          )}
        </>
      </div>
    </div>
  );
}

export default App;
